import React from 'react'
import data from './data';
import AnimalCard from './AnimalCard'

function EquipmentManager() {
    return (
        <div className="wrapper">
         <h1>Recommended</h1>
      {data.map(animal => (
        <AnimalCard key={animal.name}/>
      ))}
        </div>
    )
}

export default EquipmentManager
